from typing import List


class Solution:
    """
    TLE
    """
    def largest1BorderedSquare(self, grid: List[List[int]]) -> int:
        R, C = len(grid), len(grid[0])
        ivisited = dict()
        jvisited = dict()

        def checkSquare(istart: int, jstart: int, jend: int) -> bool:
            w = jend - jstart
            iend = istart + w - 1
            if iend >= R: return False
            if (iend, jstart, jend) not in jvisited:
                for jj in range(jstart, jend):
                    if not grid[iend][jj]:
                        return False
                    jvisited[(iend, jstart, jj+1)] = True

            if not ((istart+1, iend+1, jstart) in ivisited and (istart+1, iend+1, jend) in ivisited):
                for ii in range(istart + 1, iend+1):
                    if not grid[ii][jstart] or not grid[ii][jend-1]:
                        return False
                    ivisited[(istart+1, ii+1, jstart)] = True
                    ivisited[(istart+1, ii+1, jend)] = True
            return True

        def checkSubConsecutiveOnes(i: int, jstart: int, jend: int, maxOnes: int) -> int:
            start, end = jstart, jend
            q = [(start, end)]
            while q:
                s, e = q.pop(0)
                if e - s > maxOnes:
                    if checkSquare(i, s, e):
                        maxOnes = e - s
                        return maxOnes
                    else:
                        q.append((s+1, e))
                        q.append((s, e-1))
            return maxOnes

        maxOnes = 0
        for i in range(R):
            # print(i)
            j = 0
            while j < C:
                js = j
                while j < C and grid[i][j]:
                    j+=1
                # if grid[i][js:je] are all 1s (je exclusive)
                maxOnes = checkSubConsecutiveOnes(i, js, j, maxOnes)
                if j < C and not grid[i][j]:
                    j+=1
        return maxOnes ** 2


